Sanne runt samen met haar vader en moeder Casa Matrimonio, het luxe, vrijstaande landhuis waar ze ook wonen, in het zonovergoten ItaliÃƒÂ«. 
Het landgoed ligt in Toscane, deze schitterende streek is de ideale plek om je droombruiloft te vieren. 
In Casa Matrimonio komen gasten bij elkaar om het leven en de liefde te vieren. 
Een Toscaanse bruiloft vormt voor alle gasten het hoogtepunt van hun verblijf. 
Voor sommigen is het landgoed bekend terrein en zij komen er wel heel graag.


